import React from 'react';

function Heading () {
    return (
        <>
            <Video></Video>
            <CalcBody></CalcBody>
        </>
    )
}

function Video () {
    return (
        <>
        <video style={vid} autoPlay loop muted>
            <source src="video.mp4" type="video/mp4"></source>
        </video>
        </>
    )
}

function CalcBody () {
    return (
        <>
        <div style={backdrop}></div>
        </>
    )
}


const vid = {
    width : '100%',
    // height : '100vh',
    position : 'absolute',
    top : '0',
    left : '0',
    overflow : 'hidden',
    zIndex : '1'
}

const backdrop = {
    width: '500px',
    height : '400px',
    backgroundColor : 'rgba(255, 255, 255, .15)',
    backdropFiler :  'blur(25px)',
    background : 'inherit',
    zIndex : '1',
    filter : 'blur(2px)',
    marginTop : '50px'
}

export default Heading;
